import React from "react";
import './components/website.css';

function homePage () {
    return (
        <div>
            <div className="navbar">
                <div className="sitename">
                    <h2>Website Name</h2>
                </div>
                <div className="hmpbutton">
                    <button>Home</button>
                    <button>Maket</button>
                    <button>Profile</button>
                </div>
            </div>
        </div>
    );
}

export default homePage;
